    <div className="Footer">
        <div className="leftSideFooter">
            <img src={logo} alt="Logo"/>
            <p>The only tool youâ€™ll ever need to grow your Twitter audience and engagement in bussiness</p>
        </div>
        <div className="rightSideFooter">
